import{_ as e,o as r,c as i,O as a}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 46.2-746.7 Special license plates for members of certain civic and fraternal organizations.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/46.2-746.7.md","filePath":"vacode/46.2-746.7.md"}'),t={name:"vacode/46.2-746.7.md"},n=a('<h1 id="§-46-2-746-7-special-license-plates-for-members-of-certain-civic-and-fraternal-organizations" tabindex="-1">§ 46.2-746.7 Special license plates for members of certain civic and fraternal organizations. <a class="header-anchor" href="#§-46-2-746-7-special-license-plates-for-members-of-certain-civic-and-fraternal-organizations" aria-label="Permalink to &quot;§ 46.2-746.7 Special license plates for members of certain civic and fraternal organizations.&quot;">​</a></h1><p>On receipt of an application and written evidence that the applicant is a member of such organization, the Commissioner shall issue special license plates to members of the following organizations: the Exchange Club, the Jaycees, the Kiwanis, the Lions of Virginia, Rotary International, Ruritan National, the Freemasons, the Shriners, the Most Worshipful Prince Hall Grand Lodge of Virginia, the Order of the Eastern Star, the Knights of Columbus, and fraternities and sororities at institutions of higher education.</p><p>No license plates shall be developed and issued for fraternities or sororities at institutions of higher education until the Commissioner receives 350 or more prepaid applications and a design for each new series. All other license plates authorized under this section shall be subject to the development and issuance provisions of subdivision B 1 of § <a href="http://law.lis.virginia.gov/vacode/46.2-725/" target="_blank" rel="noreferrer">46.2-725</a>.</p><p>1995, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?951+ful+CHAP0747" target="_blank" rel="noreferrer">747</a>; 1996, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?961+ful+CHAP1026" target="_blank" rel="noreferrer">1026</a>; 1998, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?981+ful+CHAP0175" target="_blank" rel="noreferrer">175</a>; 1999, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?991+ful+CHAP0907" target="_blank" rel="noreferrer">907</a>; 2000, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?001+ful+CHAP0075" target="_blank" rel="noreferrer">75</a>; 2002, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?021+ful+CHAP0090" target="_blank" rel="noreferrer">90</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?021+ful+CHAP0864" target="_blank" rel="noreferrer">864</a>; 2003, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?031+ful+CHAP0925" target="_blank" rel="noreferrer">925</a>; 2004, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?041+ful+CHAP0717" target="_blank" rel="noreferrer">717</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?041+ful+CHAP0747" target="_blank" rel="noreferrer">747</a>; 2005, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0908" target="_blank" rel="noreferrer">908</a>.</p>',4),o=[n];function l(s,c,f,g,h,p){return r(),i("div",null,o)}const v=e(t,[["render",l]]);export{_ as __pageData,v as default};
